import { useEffect,useState } from 'react'
import axios from 'axios'
import React from 'react'

const WhoAmI = () => {
    const token = "06b0992449f34d2dad91bf12d0bd5b15";
    const[users,setUsers]=useState({
        basespace:[]
    })
    useEffect(() => {
		axios.get('https://api.basespace.illumina.com/v1pre3/users/current',
        {
            method: 'GET',
            headers: {
              'Authorization': `Bearer ${token}`,
              'Content-Type': 'application/json'
            }
        }
        ).then((res) => {
			const allUsers = res.data;
			setUsers({ loading: false, basespace: allUsers });
			console.log(res.data);
		});
	}, [setUsers]);
    return (
        <div>
            {users.basespace.map((item)=>{
                return(
                    <div key={item.id}>

                        <h2>{item.Email}</h2>
                    </div>

                )

            })}

        </div>
    )
}

export default WhoAmI
